	struct sound{
	const unsigned char *wave; 
	uint32_t length; 
};	
	

typedef struct sound sound_t;
	
	
sound_t sounds[3] = {
	{alarmWav, alarmLen},
	{WinWav, WinLen},
	{AccelWav, AccelLen}
};
	
soundEffect sound2play; 

void Timer2A_Stop(void); 
uint32_t pIndex = 0;
void playSample(){
	DAC_Out(sounds[sound2play].wave[pIndex++]); 

	if (pIndex >= sounds[sound2play].length){
		Timer2A_Stop();
		pIndex = 0;
	}
}

void playSound(soundEffect sound){
	sound2play = sound; 
	Timer2A_Init(&playSample, 80000000/11025, 1); 
}


// define a background task to run at 11 kHz, which outputs one value to DAC each interrupt


//---------------------------------------------------------------


void Sound_Init(void){
// write this
  // initialize a 11kHz timer, and the DAC
	DAC_Init();
	 
  NVIC_ST_CTRL_R = 0; // disable SysTick
	NVIC_ST_CURRENT_R = 0; // clear count
	NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000; // priority
};

//******* Sound_Start ************
// This function does not output to the DAC. 
// Rather, it sets a pointer and counter, and then enables the timer interrupt.
// It starts the sound, and the timer ISR does the output
// feel free to change the parameters
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement


void Sound_Start(const uint8_t *pt, uint32_t count){
// write this
	NVIC_ST_CTRL_R = 7; // ENABLE, INTEN, CLK SRC
};
